import React, { Component } from 'react';
import { Card, Icon } from 'semantic-ui-react'


import logo from './assets/logo.png';
import './App.css';

class AdminHome extends Component {
    constructor(props){
      super(props);
      this.state={
        loading: true
      }
    }

    render() {
      return (
        <div className="App">
        <center>
        <Card>
    <Card.Content header='About Amy' />
    <Card.Content description="Testing" />
    <Card.Content extra>
      <Icon name='user' />
      4 Friends
    </Card.Content>
  </Card>
        </center>

        </div>
      );
    }
  }

  export default AdminHome;
